                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              /> 
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top:  Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top:  Math.floor(Math.random() * (max - min) + min) + "%",
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: 0,
                }}
              />
              <img
                src={require("../img/bula.png").default}
                alt=""
                style={{
                  left: Math.floor(Math.random() * (max - min) + min) + "%",
                  top: 0,
                }}
              />
            </div>
          </div>
        </>
      )}
    </>
  );
}

export default Bule;
